My Invisible Playmate (Split Scenes)

Alec Metro, Allysin Chaynes, Chris Cannon, Dee, Elizabeth X, Ian Daniels, Mark Vega, Shaena Steel

Do you remember playing with your invisible friend as a child? Stuart knows he can see, touch and taste his friend, Solyana. The problem is, no one else can. Turns out, she is trapped between two dimensions and Stuart's research has almost found the key to unlock the gate to free his friend! In the meantime, Stuart's girlfriend and business partner are scheming to have him committed and take control of his holdings! All the while, Solyana shows Stuart how sweet it will be when all of her is there to play with!

